public class Solution {
    public int SpecialPerm(int[] nums) {
        int n = nums.Length;
        long mod = 1000000007;
        long[,] dp = new long[1 << n, n];
        for (int i = 0; i < n; ++i) {
            dp[1 << i, i] = 1;
        }
        for (int mask = 0; mask < (1 << n); ++mask) {
            for (int i = 0; i < n; ++i) {
                if ((mask & (1 << i)) != 0) {
                    for (int j = 0; j < n; ++j) {
                        if ((mask & (1 << j)) == 0 && (nums[i] % nums[j] == 0 || nums[j] % nums[i] == 0)) {
                            dp[mask | (1 << j), j] = (dp[mask | (1 << j), j] + dp[mask, i]) % mod;
                        }
                    }
                }
            }
        }
        long ans = 0;
        for (int i = 0; i < n; ++i) {
            ans = (ans + dp[(1 << n) - 1, i]) % mod;
        }
        return (int)ans;
    }
}
